import './App.css';
import header from './header.js';
import menu from './menu.js';
import dashboard from './dashboard.js';
import footer from './footer.js';

function App() {
    return ( 
    <div class="wrapper">
        <header/>
        <menu/>
        <dashboard/>
        <footer/>
    </div>
    );
}

export default App;
